import "./style.css";



const LoginForm = () => {




    return (
        <div className="login-page">
            <div className="form-container">
                <h1>Login</h1>
                <form action="http://localhost:8000/login" method="POST">
                    <label htmlFor="loginUsername">Username:</label><br/>
                    <input className="input" type="text" name="loginUsername" id="login-username-input"/><br/>
                    <label htmlFor="loginPassword">Password:</label><br/>
                    <input className="input" type="text" name="loginPassword" id="login-password-input"/><br/>
                    <input type="submit" value="Login"/>
                </form>
            </div>
        </div>
    );
}


export default LoginPage;
